import React, { Component, Fragment } from 'react';
import './Footer.css';

const Footer = function () {
    return <Fragment>
        <footer>
            <p>Este site foi um trabalho desenvolvido pelo aluno Gabriel Garcia, utilizando a tecnologia ReactJS.</p>
        </footer>
    </Fragment>;
}

export default Footer;
